import './index.css';

function arr2obj(arr) {

  let obj = [];

  arr.forEach(v => {

    let key = v[0];
    let value = v[1];

    obj[key] = value;
  });
return obj;
}
document.write(

  arr2obj([
    ["Joe", 12],
    ["Jack", 13],
    ["Matt", 14],
    ["Maxx", 15],
  ])
);
